//cdn.hyperbridge.org/blockhub/images/products/might-&-magic-heroes-vi-4896/preview-04.jpg","https://cdn.hyperbridge.org/blockhub/images/products/might-&-magic-heroes-vi-4896/preview-05.jpg","https://cdn.hyperbridge.org/blockhub/images/products/might-&-magic-heroes-vi-4896/preview-06.jpg"]},video:null,genre:"RPG",release_date:"13 Oct, 2011",developer:"Blackhole",publisher:"Ubisoft",content:"The adventure in Heroes VI, starting 400 years before events in Heroes V, catapults a family of heroes into a fast-paced epic story where Angels plot to end -- once and for all -- an unfinished war with their ancient rivals, the Faceless. <br><br>\t\t\t\t\t\tA legendary Archangel General is resurrected, but with his powers crippled. Plagued by horrible memories of the Elder Wars, he plots to recover his powers and take control of Ashan while destroying both Faceless and Demons in a series of carefully orchestrated attacks and betrayals. He underestimates, however, the power of the all-too-human Griffin dynasty. <br><br>\t\t\t\t\t\tThe destiny of these Griffin heroes will be determined by our players.<br><br>\t\t\t\t\t\t<ul><li>Soundtrack.<br>\t\t\t\t\t\t</li><li>Artbook/Poster.<br>\t\t\t\t\t\t</li><li>One month subscription on Heroes Kingdom.<br>\t\t\t\t\t\t</li><li>1 Bonus Single Player Skirmish Map.<br>\t\t\t\t\t\t</li><li>4 Dynasty Heroes : Aguirre, Sveltana, Yume and Kraal.<br>\t\t\t\t\t\t</li><li>2 Dynasty Weapon : Staff of Cleansing and Staff of Asha&#x2019;s Eightfold.</li></ul> Content is delivered via download only.<br><br>\t\t\t\t\t\t<ul><li>Enjoy the critically acclaimed Heroes gameplay, remasterized with the well-known developer, Black Hole, and in close partnership with the game&#x2019;s numerous fans.<br>\t\t\t\t\t\t</li><li><strong>Experience the unique mix of Turn-Based Strategy &amp; RPG:</strong> Explore extra-large adventure maps, collect tons of resources and build extraordinary cities. Perfect your tactics to level-up your heroes, recruit troops &amp; ready them for combat on exclusive battle maps.<br>\t\t\t\t\t\t</li><li><strong>Shape your destiny:</strong> Lead the Heroes of the Griffin dynasty through an intriguing scenario. Choose your path, assume your choices and customize your gaming experience thanks to a brand new Reputation system.<br>\t\t\t\t\t\t</li><li><strong>Rediscover the richness of the M&amp;M Universe:</strong> Discover fantastic landscapes and creatures from the world of Ashan.  Enjoy improved 3D designs and an exclusive new bestiary.<br>\t\t\t\t\t\t</li><li><strong>Share with the community:</strong> Post content &amp; compete with your friends using a new and intelligent, online community interface.</li></ul>",developer_tags:["Strategy","RPG","Turn-Based Strategy","Turn-Based","Fantasy","Multiplayer"],language_support:[{name:"English",interface:!0,full_audio:!1,subtitles:!1},{name:"Czech",interface:!0,full_audio:!1,subtitles:!1},{name:"French",interface:!0,full_audio:!1,subtitles:!1},{name:"German",interface:!0,full_audio:!1,subtitles:!1},{name:"Hungarian",interface:!0,full_audio:!1,subtitles:!1},{name:"Italian",interface:!0,full_audio:!1,subtitles:!1},{name:"Korean",interface:!0,full_audio:!1,subtitles:!1},{name:"Polish",interface:!0,full_audio:!1,subtitles:!1},{name:"Russian",interface:!0,full_audio:!1,subtitles:!1},{name:"Spanish",interface:!0,full_audio:!1,subtitles:!1}],system_requirements:[{os:"win",system:"Windows XP, Windows Vista, Windows 7 (all 32/64 bit)",processor:"Intel Pentium Core 2 @ Duo E6400 @ 2.00 Ghz, AMD Athlon II X2 240 @ 2.8 Ghz",memory:"2 GB for Windows XP and 2GB for Vista / Windows 7",graphics:"1 GB, DirectX 9.0c",directx:"9.0c",hard_drive:"8 GB",sound:"DirectX 9.0c compatible",special_info:"ATI® RADEON® HD 6000 Series"}],system_tags:["new","featured","upcoming"],type:"game",downloads:0,plans:[],frequently_traded_assets:[],rating:{overall:4,items:[{name:"Joe Murray",number:5},{name:"Jake Marshall",number:3.5},{name:"Dylan Greene",number:4.5},{name:"Emma Wilkins",number:2.5}],fullReviewsLink:"#fullReviewsLink",rateGameLink:"#rateGameLink"},assets:[],community:{discussions:[]},name_url:"might-&-magic-heroes-vi-4896"},{id:2,name:"Capsized",price:4.99,old_price:7.99,images:{header:null,medium_tile:"https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/med-tile.jpg",main:null,icon:"https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/icon.jpg",preview:["https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-01.jpg","https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-02.jpg","https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-03.jpg","https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-04.jpg","https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-05.jpg","https://cdn.hyperbridge.org/blockhub/images/products/capsized-5004/preview-06.jpg"]},video:null,genre:"Action",release_date:"29 Apr, 2011",developer:"Alientrap",publisher:"Alientrap",content:"<strong>Capsized</strong> is a fast paced 2D platformer focused on intense action and exploration. As a intrepid space traveler, your ship has crash landed on a mysterious alien planet. You must navigate through the perilous environment and fight off blood-thirsty creatures to save your crewmates and escape with your lives!<br>\t\t\t\t\t\tArtist Jesse McGibney and programmer Lee Vermeulen create an immersive alien world teeming with bizarre life-forms and strange landscapes presented in a unique hand-drawn art style. Combining control elements of first person shooters and innovative physics based combat, Capsized emphasizes action without giving up the smart problem solving of classic platform games.<br>\t\t\t\t\t\tUse your jetpack to fly through the alien jungle, and tools such as the Gravity Hook to manipulate your environment to skilfully dodge and defeat attacking enemies. You will be challenged - with platforming, puzzle solving, and deadly skirmishing, often all at the same time!<br>\t\t\t\t\t\t\t\t\t\t\t\t<ul><li>Highly detailed alien environments and creatures, lovingly rendered with high resolution hand-drawn artwork.<br>\t\t\t\t\t\t</li><li>12 mission Campaign featuring: massive non-linear environments, diverse objectives and enemies, and exciting comic-style cutscenes.<br>\t\t\t\t\t\t</li><li>4 extra Arcade Modes to unlock, including: local Deathmatch and Coop, Survival mode, Time Trials, and Armless fighting.<br>\t\t\t\t\t\t</li><li>Lethal arsenal of futuristic weapons and gadgets such as: the Gravity Ram, Jetpack, Energy Shield, and Quasar Array<br>\t\t\t\t\t\t</li><li>Classic First Person Shooter inspired controls, with a focus on skilled movement, creative tactics, and insane action.<br>\t\t\t\t\t\t</li></ul>",developer_tags:["Action","Platformer","Indie","Sci-fi","Local Co-Op","2D"],language_support:[{name:"English",interface:!0,full_audio:!1,subtitles:!1}],system_requirements:[{os:"win",system:"XP/Vista/Windows 7",processor:"Dual-core processor (Intel Dual Core 2.0 GHz or AMD Athlon X2 5200+ 2.6 GHz)",memory:"1.5 GB RAM",hard_disk_space:"1.0 GB free space",video_card:"DirectX 9.0c compatible",sound:"DirectX 9.0c compatible sound cards"},{os:"mac",system:"Lion 10.7.5, Yosemite strongly recommended",processor:"Dual Core CPU",memory:"1.5 GB RAM",hard_disk_space:"1.0 GB free space",video_card:"OpenGL 3.0+ support (2.1 with ARB extensions acceptable)"},{os:"linux",system:"glibc 2.15+, 32/64-bit. S3TC is NOT required.",processor:"Dual Core CPU",memory:"1.5 GB RAM",hard_disk_space:"1.0 GB free space",video_card:"OpenGL 3.0+ support (2.1 with ARB extensions acceptable)"}],system_tags:["upcoming","trending"],type:"game",downloads:0,plans:[],frequently_traded_assets:[],rating:{overall:3.5,items:[{name:"Dan Dyer",number:3},{name:"Jake Clark",number:4.5},{name:"Victoria Jones",number:1.5},{name:"Anne Bower",number:1}],fullReviewsLink:"#fullReviewsLink",rateGameLink:"#rateGameLink"},assets:[],community:{discussions:[]},name_url:"capsized-5004"},{id:3,name:"DOOM",price:39.99,old_price:49.99,images:{header:null,medium_tile:"https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/med-tile.jpg",main:null,icon:"/static/img/doom-20087/icon.jpg",preview:["https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-01.jpg","https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-02.jpg","https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-03.jpg","https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-04.jpg","https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-05.jpg","https://cdn.hyperbridge.org/blockhub/images/products/doom-20087/preview-06.jpg"]},video:"https://cdn.hyperbridge.org/blockhub/videos/products/doom-20087/trailer.mp4",genre:"Action",release_date:"12 May, 2016",developer:"id Software",publisher:"Bethesda Softworks",content:'Developed by id software, the studio that pioneered the first-person shooter genre and created multiplayer Deathmatch, DOOM returns as a brutally fun and challenging modern-day shooter experience. Relentless demons, impossibly destructive guns, and fast, fluid movement provide the foundation for intense, first-person combat &#x2013; whether you&#x2019;re obliterating demon hordes through the depths of Hell in the single-player campaign, or competing against your friends in numerous multiplayer modes. Expand your gameplay experience using DOOM SnapMap game editor to easily create, play, and share your content with the world. <br><br><img src="https://steamcdn-a.akamaihd.net/steam/apps/379720/extras/doom-giffy-under-10.jpg?t=1533678963"><br><br><strong>STORY:</strong><br>You&#x2019;ve come here for a reason. The Union Aerospace Corporation&#x2019;s massive research facility on Mars is overwhelmed by fierce and powerful demons, and only one person stands between their world and ours.  As the lone DOOM Marine, you&#x2019;ve been activated to do one thing &#x2013; kill them all.<ul><li><strong>A Relentless Campaign</strong><br>There is no taking cover or stopping to regenerate health as you beat back Hell&#x2019;s raging demon hordes.  Combine your arsenal of futuristic and iconic guns, upgrades, movement and an advanced melee system to knock-down, slash, stomp, crush, and blow apart demons in creative and violent ways. <br><br></li><li><strong>Return of id Multiplayer</strong><br>Dominate your opponents in DOOM&#x2019;s signature, fast-paced arena-style combat. In both classic and all-new game modes, annihilate your enemies utilizing your personal blend of skill, powerful weapons, vertical movement, and unique power-ups that allow you to play as a demon.<br><br></li><li><strong>Endless Possibilities</strong><br>DOOM SnapMap &#x2013; a powerful, but easy-to-use game and level editor &#x2013; allows for limitless gameplay experiences on every platform.  Without any previous experience or special expertise, any player can quickly and easily snap together and visually customize maps, add pre-defined or completely custom gameplay, and even edit game logic to create new modes.  Instantly play your creation, share it with a friend, or make it available to players around the world &#x2013; all in-game with the push of a button.</li></ul>',developer_tags:["FPS","Action","Gore","Demons","Shooter","First-Person"],language_support:[{name:"English",interface:!0,full_audio:!0,subtitles:!0},{name:"French",interface:!0,full_audio:!0,subtitles:!0},{name:"Italian",interface:!0,full_audio:!0,subtitles:!0},{name:"German",interface:!0,full_audio:!0,subtitles:!0},{name:"Spanish",interface:!0,full_audio:!0,subtitles:!0},{name:"Japanese",interface:!0,full_audio:!0,subtitles:!0},{name:"Polish",interface:!0,full_audio:!0,subtitles:!0},{name:"Portuguese-Brazil",interface:!0,full_audio:!0,subtitles:!0},{name:"Russian",interface:!0,full_audio:!0,subtitles:!0},{name:"Traditional Chinese",interface:!0,full_audio:!1,subtitles:!0}],system_requirements:[{os:"win",system:"Windows 7/8.1/10 (64-bit versions)",processor:"Intel Core i7-3770/AMD FX-8350 or better",memory:"8 GB RAM",graphics:"NVIDIA GTX 970 4GB/AMD Radeon R9 290 4GB or better",storage:"55 GB available space",additional_notes:"Requires Steam activation and broadband internet connection for Multiplayer and SnapMap"}],system_tags:["sale","featured","trending","top_seller","specials"],type:"game",downloads:0,plans:[],frequently_traded_assets:[],rating:{overall:5,items:[{name:"Keith Reid",number:5},{name:"Neil Buckland",number:5}],fullReviewsLink:"#fullReviewsLink",rateGameLink:"#rateGameLink"},assets:[],community:{discussions:[]},name_url:"doom-20087"},{id:4,name:"A Game of Thrones - Genesis",price:12.99,old_price:14.99,images:{header:null,medium_tile:"https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/med-tile.jpg",main:null,icon:"https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/icon.jpg",preview:["https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-01.jpg","https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-02.jpg","https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-03.jpg","https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-04.jpg","https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-05.jpg","https://cdn.hyperbridge.org/blockhub/images/products/a-game-of-thrones---genesis-4221/preview-06.jpg"]},video:null,genre:"Strategy",release_date:"29 Sep, 2011",developer:"Cyanide Studios",publisher:"Focus Home Interactive",content:"What King will you be?<br>\t\t\t\t\t\t\tConqueror, Usurper or Diplomat?<br>\t\t\t\t\t\t\t<strong>&quot;A Game of Thrones - Genesis&quot;</strong> immerses you into the heart of the battles and intrigues between the Houses that shaped the Kingdom of Westeros. From Nymeria&apos;s arrival in the Kingdom of Dorne to the awakening of the &quot;Others&quot; beyond the Wall, you&apos;ll live the origins of A Game of Thrones saga through more than 1000 years of history, by taking part in Westeros&apos; founding events and largest battles.<br>\t\t\t\t\t\t\tIn this great strategy game, victory does not necessarily result from brute force. You can choose to use a military approach and besiege your opponents, strangle them in an economical war, or even use dirty tricks and diplomacy to politically crush them. Treachery and deception are everywhere and can be more efficient than the most powerful army. So watch your back and show no mercy if you want to keep sat on the Iron Throne.<br>\t\t\t\t\t\t\t<ul><li>The video game adaptation of the fantasy saga &quot;A Song of Ice and Fire&quot; by George RR Martin.<br>\t\t\t\t\t\t\t</li><li>A deep and exciting gameplay combining strategy, diplomacy and politics.<br>\t\t\t\t\t\t\t</li><li>Discover the origins of the universe of the Iron Throne through the Story mode, and participate in major conflicts that have shaped Westeros.<br>\t\t\t\t\t\t\t</li><li>Compete against up to 7 other players in multiplayer. Form alliances, break them, show subtle tactics and crush your opponents!</li></ul>",developer_tags:["Strategy","RTS","Fantasy","Multiplayer"],language_support:[{name:"English",interface:!0,full_audio:!1,subtitles:!1},{name:"French",interface:!0,full_audio:!1,subtitles:!1},{name:"German",interface:!0,full_audio:!1,subtitles:!1},{name:"Italian",interface:!0,full_audio:!1,subtitles:!1},{name:"Spanish",interface:!0,full_audio:!1,subtitles:!1}],system_requirements:[{os:"win",system:"WINDOWS XP SP2/VISTA SP1/WINDOWS 7",processor:"AMD/INTEL DUAL-CORE 2.2 GHZ",memory:"1024 MB (XP) / 2048 MB (VISTA/7)",graphics:"256 MB 100% DIRECTX 9 AND SHADERS 3.0 COMPATIBLE.  ATI RADEON X1600 XT/INTEL HD/NVIDIA GEFORCE 6600 GT OR HIGHER",directx:"9",hard_drive:"10 GB",sound:"DIRECTX 9 COMPATIBLE",internet:"INTERNET CONNECTION REQUIRED FOR ONLINE GAMING AND GAME ACTIVATION"}],system_tags:["top_seller","specials"],type:"game",downloads:0,plans:[],frequently_traded_assets:[],rating:{overall:3.5,items:[{name:"Dan Dyer",number:3},{name:"Jake Clark",number:4.5},{name:"Victoria Jones",number:1.5},{name:"Anne Bower",number:1}],fullReviewsLink:"#fullReviewsLink",rateGameLink:"#rateGameLink"},assets:[],community:{discussions:[]},name_url:"a-game-of-thrones---genesis-4221"},{id:5,name:"Teeworlds",price:0,old_price:14.99,images:{header:null,medium_tile:"https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/med-tile.jpg",main:null,icon:"https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/icon.jpg",preview:["https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/preview-01.jpg","https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/preview-02.jpg","https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/preview-03.jpg","https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/preview-04.jpg","https://cdn.hyperbridge.org/blockhub/images/products/teeworlds-20137/preview-05.jpg"]},video:"https://cdn.hyperbridge.org/blockhub/videos/products/teeworlds-20137/trailer.mp4",genre:"Action",release_date:"27 May, 2007",developer:"Teeworlds Team",publisher:"Teeworlds Team",content:"Play together with your friends and have a fun time! In Teeworlds you can play in three gamemodes (Deathmatch, Team-Deathmatch and Capture The Flag) and tons more of community-made modifications with up to 16 players!<br><br>Customize your own player character, your personal tee, to your liking. With hundreds of possible combinations, you will always look unique!<br><br>Teeworlds is a game that gives you a lot of freedom and plenty of gameplay mechanics to use or abuse. With a full focus on multiplayer games you will never be bored.<br><br>And the best thing: It&apos;s open-source! Anyone can help to develop this game, create new game types, skins or brand new maps via the built-in map editor!<br><br>Key Features:<br><ul><li>Easy to learn, hard to master. You will never stop learning new tricks while playing Teeworlds, no matter how long you play. At the same time it&apos;s easy for new players to just pick it up and have a blast.<br><br></li><li>Engaging and motivated community. Teeworlds&apos; one-of-a-kind community is the thing keeping the game alive. Be it the community servers or maps or all the other innovative content.<br><br></li><li>Play with your friends for free. Teeworlds has been free since the very start and will stay that way forever. With up to 16 players in a match, challenge your friends - the fun is only a mouseclick away!</li></ul>",developer_tags:["Free to Play","Multiplayer","2D","Action","Platformer","Shooter"],language_support:[{name:"English",interface:!0,full_audio:!1,subtitles:!1},{name:"French",interface:!0,full_audio:!1,subtitles:!1},{name:"Italian",interface:!0,full_audio:!1,subtitles:!1},{name:"German",interface:!0,full_audio:!1,subtitles:!1},{name:"Spanish",interface:!0,full_audio:!1,subtitles:!1},{name:"Bulgarian",interface:!0,full_audio:!1,subtitles:!1},{name:"Czech",interface:!0,full_audio:!1,subtitles:!1},{name:"Danish",interface:!0,full_audio:!1,subtitles:!1},{name:"Dutch",interface:!0,full_audio:!1,subtitles:!1},{name:"Finnish",interface:!0,full_audio:!1,subtitles:!1},{name:"Hungarian",interface:!0,full_audio:!1,subtitles:!1},{name:"Norwegian",interface:!0,full_audio:!1,subtitles:!1},{name:"Polish",interface:!0,full_audio:!1,subtitles:!1},{name:"Portuguese",interface:!0,full_audio:!1,subtitles:!1},{name:"Portuguese-Brazil",interface:!0,full_audio:!1,subtitles:!1},{name:"Romanian",interface:!0,full_audio:!1,subtitles:!1},{name:"Russian",interface:!0,full_audio:!1,subtitles:!1},{name:"Swedish",interface:!0,full_audio:!1,subtitles:!1},{name:"Turkish",interface:!0,full_audio:!1,subtitles:!1}],system_requirements:[{os:"win",system:"Microsoft® Windows® XP or newer",processor:"